def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])

    def dfs(i, j, path):
        if len(path) == k:
            return path

        neighbors = [(0, 1), (1, 0), (0, -1), (-1, 0)]
        result = []

        for dx, dy in neighbors:
            ni, nj = i + dx, j + dy

            if 0 <= ni < n and 0 <= nj < m:
                result.append((grid[ni][nj], ni, nj))

        result.sort()

        for val, ni, nj in result:
            grid[ni][nj] = -1
            res = dfs(ni, nj, path + [val])
            if res:
                return res
            grid[ni][nj] = val

        return []

    for i in range(n):
        for j in range(m):
            if grid[i][j] == 1:
                grid[i][j] = -1
                return dfs(i, j, [1])

